import React from 'react';
import { View,Image } from 'react-native';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch } from '@fortawesome/free-solid-svg-icons'; 

import { headerstyles } from '../Styles/HeaderStyle';

export default function Header() {
  return (
    <View style={headerstyles.container}>
      <FontAwesomeIcon style={headerstyles.magnifyingglass} icon={faSearch} /> 
      <View style={headerstyles.containerforavatar}>
      <Image source={{uri:"https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fthumb%2F6%2F68%2FJoe_Biden_presidential_portrait.jpg%2F274px-Joe_Biden_presidential_portrait.jpg&tbnid=Idevxl6wr1V-9M&vet=12ahUKEwjPs6bClLuBAxVLBxAIHZjgBYAQMygAegQIARAz..i&imgrefurl=https%3A%2F%2Fru.wikipedia.org%2Fwiki%2F%25D0%2591%25D0%25B0%25D0%25B9%25D0%25B4%25D0%25B5%25D0%25BD%2C_%25D0%2594%25D0%25B6%25D0%25BE&docid=z7MBRVJPRPvZQM&w=274&h=342&q=%D0%B1%D0%B0%D0%B9%D0%B4%D0%B5%D0%BD&ved=2ahUKEwjPs6bClLuBAxVLBxAIHZjgBYAQMygAegQIARAz"}} style={headerstyles.avatar}></Image>
      </View>
    </View>
  );
}
